import { 
  Box,
  Typography
} from '@material-ui/core';

import { LOADINGCOLOR } from '../color/loading.js';

const Loading = ({
    
}) => {
  return(
    <Box
      display='flex'
      justifyContent='center'
      bgcolor={LOADINGCOLOR}
      height='inherit'
    >
      <Typography></Typography>>
    </Box>
    )
}

export default Loading;
